export function Navbar() {
  return (
    <nav className="fixed top-6 left-1/2 transform -translate-x-1/2 z-50">
      <ul className="flex bg-gray-800 bg-opacity-60 backdrop-blur-md text-white rounded-full px-6 py-2 gap-6 text-sm font-medium shadow-md">
        <li><a href="#home" className="hover:text-blue-400 transition">Home</a></li>
        <li><a href="#About me" className="hover:text-blue-400 transition">About me</a></li>
        <li><a href="#Skill" className="hover:text-blue-400 transition">Skill</a></li>
        <li><a href="#contact" className="hover:text-blue-400 transition">Contact</a></li>
        <li><a href="#portfolio" className="hover:text-blue-400 transition">Portfolio</a></li>
      </ul>
    </nav>
  );
}
